// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import '@openzeppelin/contracts-upgradeable/proxy/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts-upgradeable/token/ERC20/SafeERC20Upgradeable.sol';
import './characters.sol';
import './weapons.sol';
import './interfaces/IRandoms.sol';
import './CraftingItems.sol';

contract ArmorySale is Initializable, AccessControlUpgradeable, PausableUpgradeable {
    using SafeMath for uint8;
    using SafeMath for uint256;
    using SafeERC20Upgradeable for IERC20;

    struct Bundle {
        uint8 count;
        uint8 price;
    }

    struct WeaponsFilter {
        uint8 limit;
        uint256 pageNumber;
        uint8 element;
        uint8 quality;
        uint8 gunType;
        uint8 holographic;
    }

    Characters public characters;
    Weapons public weapons;
    IRandoms public randoms;
    IERC20 public TAG;
    CraftingItems public craftingItems;

    function initialize(
        Characters _characters,
        Weapons _weapons,
        IRandoms _randoms,
        address _tag
    ) public initializer {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);

        TAG = IERC20(_tag);

        characters = _characters;
        randoms = _randoms;
        weapons = _weapons;

        tagPriceInUSD = 2000000000000000;
        bundleList[0] = Bundle({count: 1, price: 10});
        bundleList[1] = Bundle({count: 5, price: 40});
        bundleList[2] = Bundle({count: 10, price: 75});
    }

    uint256 public tagPriceInUSD;
    mapping(address => uint256) lastBlockNumberCalled;
    mapping(uint8 => Bundle) public bundleList;
    mapping(uint256 => bool) public whitelistedCharacterIds;

    event weaponMinted(address indexed buyer, uint8 amount);

    function setBundlePrice(
        uint8 index,
        uint8 _count,
        uint8 _price
    ) external onlyOwner {
        bundleList[index] = Bundle({count: _count, price: _price});
    }

    function setCraftingItems(CraftingItems _craftingItems) external onlyOwner {
        craftingItems = _craftingItems;
    }

    function buyWeapons(uint8 bundleType)
        public
        whenNotPaused
        // onlyNonContract
        oncePerBlock(msg.sender)
    {
        require(characters.balanceOf(msg.sender) > 0, 'Please buy operators to mint your free weapons');
        uint256 baseSeed = randoms.getRandomSeed(msg.sender);

        // free weapons -- called only first time
        if (checkIfFreeWeaponsLeft()) {
            uint256[] memory characterIds = getMyCharacters();
            uint8 count;
            for (uint256 i = 0; i < characterIds.length; i++) {
                if (!whitelistedCharacterIds[characterIds[i]]) {
                    uint256 indexSeed = RandomUtil.combineSeeds(baseSeed, i);
                    weapons.mint(true, msg.sender, indexSeed);
                    whitelistedCharacterIds[characterIds[i]] = true; // whitelisted the character id
                    count = uint8(count.add(1));
                }
            }
            emit weaponMinted(msg.sender, count);
        } else {
            Bundle memory b = bundleList[bundleType];
            uint256 sellPrice = (b.price.mul(10**18)).div(tagPriceInUSD).mul(10**18);
            require(TAG.allowance(msg.sender, address(this)) >= sellPrice, 'Not enough TAG allowance');

            // get tags
            TAG.transferFrom(msg.sender, address(this), sellPrice);

            // mint X amount of weapons
            for (uint8 i = 0; i < b.count; i++) {
                uint256 indexSeed = RandomUtil.combineSeeds(baseSeed, uint256(i));
                weapons.mint(false, msg.sender, indexSeed);
            }
            emit weaponMinted(msg.sender, b.count);
        }
    }

    function buyWeaponsWithParts(uint8 bundleType)
        public
        whenNotPaused
        oncePerBlock(msg.sender)
    {
        require(characters.balanceOf(msg.sender) > 0, 'Please buy operators to mint your free weapons');
        uint256 baseSeed = randoms.getRandomSeed(msg.sender);

        Bundle memory bundle = bundleList[bundleType];
        uint256 sellPrice = (bundle.price.mul(10**18)).div(tagPriceInUSD).mul(10**18);
        sellPrice = sellPrice.mul(5);
        require(craftingItems.isApprovedForAll(msg.sender, address(this)), 'Approval needed before salvaging PARTs');

        // burn PARTs
        craftingItems.burnParts(msg.sender, sellPrice);

        // mint X amount of weapons
        for (uint8 i = 0; i < bundle.count; i++) {
            uint256 indexSeed = RandomUtil.combineSeeds(baseSeed, uint256(i));
            weapons.mint(false, msg.sender, indexSeed);
        }
        emit weaponMinted(msg.sender, bundle.count);
    }

    function withdrawTAG(uint256 amount) public onlyOwner {
        require(TAG.balanceOf(address(this)) >= amount, 'Not enough amount');
        TAG.transfer(msg.sender, amount);
    }

    function getMyWeapons() public view returns (uint256[] memory) {
        uint256[] memory tokens = new uint256[](weapons.balanceOf(msg.sender));
        for (uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = weapons.tokenOfOwnerByIndex(msg.sender, i);
        }
        return tokens;
    }

    function getMyCharacters() private view returns (uint256[] memory) {
        uint256[] memory tokens = new uint256[](characters.balanceOf(msg.sender));
        for (uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = characters.tokenOfOwnerByIndex(msg.sender, i);
        }
        return tokens;
    }

    function checkIfFreeWeaponsLeft() private view returns (bool) {
        uint256[] memory characterIds = getMyCharacters();
        bool stillLeft;
        for (uint256 i = 0; i < characterIds.length; i++) {
            if (!whitelistedCharacterIds[characterIds[i]]) {
                stillLeft = true;
            }
        }
        return stillLeft;
    }

    function getWeaponListingIDsPage(WeaponsFilter memory filter) public view returns (uint256[] memory) {
        uint256 matchingWeaponsAmount = getNumberOfWeaponListings(filter);
        uint256 pageEnd = filter.limit * (filter.pageNumber + 1);
        uint256 tokensSize = matchingWeaponsAmount >= pageEnd
            ? filter.limit
            : matchingWeaponsAmount.sub(filter.limit * filter.pageNumber);

        return _getWeaponListingIDsPage(filter, pageEnd, tokensSize);
    }

    function _getWeaponListingIDsPage(
        WeaponsFilter memory filter,
        uint256 pageEnd,
        uint256 tokensSize
    ) internal view returns (uint256[] memory) {
        uint256[] memory userWeapons = getMyWeapons();
        uint256[] memory tokens = new uint256[](tokensSize);
        uint256 counter = 0;
        uint8 tokenIterator = 0;

        for (uint256 i = 0; i < userWeapons.length && counter < pageEnd; i++) {
            if (_weaponPassesFilter(userWeapons[i], filter)) {
                if (counter >= pageEnd - filter.limit) {
                    tokens[tokenIterator] = userWeapons[i];
                    tokenIterator++;
                }
                counter++;
            }
        }

        return tokens;
    }

    function getNumberOfWeaponListings(WeaponsFilter memory filter) public view returns (uint256) {
        uint256[] memory userWeapons = getMyWeapons();
        uint256 counter = 0;

        for (uint256 i = 0; i < userWeapons.length; i++) {
            if (_weaponPassesFilter(userWeapons[i], filter)) {
                counter++;
            }
        }
        return counter;
    }

    function _weaponPassesFilter(uint256 weaponId, WeaponsFilter memory filter) internal view returns (bool) {
        (, , , uint8 gunType, uint8 element, uint8 quality, , bool holographic) = weapons.get(weaponId);

        uint8 noFilter = 255;

        return
            (filter.gunType == noFilter || gunType == filter.gunType) &&
            (filter.element == noFilter || element == filter.element) &&
            (filter.quality == noFilter || quality == filter.quality) &&
            (filter.holographic == noFilter || holographic == (filter.holographic != 0));
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function _onlyOwner() internal view {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role needed.');
    }

    function _oncePerBlock(address user) internal {
        require(lastBlockNumberCalled[user] < block.number, 'OCS');
        lastBlockNumberCalled[user] = block.number;
    }

    function _onlyNonContract() internal view {
        require(tx.origin == msg.sender);
    }

    modifier oncePerBlock(address user) {
        _oncePerBlock(user);
        _;
    }

    modifier onlyOwner() {
        _onlyOwner();
        _;
    }

    modifier onlyNonContract() {
        _onlyNonContract();
        _;
    }
}
